    unsigned int m_minShowerClusterHits;
    bool m_useShowerClusteringApproximation;
    bool m_cheatTrackShowerId;
    
    double GetSVMScore(const EventInputs &eventInputs, TrainingSetInputsList trainingSetInputsList) const;
    
